--PERSON TABEL DIRECTORS
INSERT INTO FLETNIX.dbo.Person
SELECT (CAST( Id AS int) + (SELECT MAX(CAST(Id as INT)) FROM MYIMDB.dbo.Imported_Person)) AS person_id ,
LEFT(Lname,50) AS lastname ,
LEFT(Fname,50) AS firstname ,
NULL AS gender
FROM MYIMDB.dbo.Imported_Directors

--PERSON TABLE
INSERT INTO FLETNIX.dbo.Person
SELECT CAST( Id AS int) AS person_id ,
LEFT(Lname,50) AS lastname ,
LEFT(Fname,50) AS firstname ,
Gender AS gender
FROM MYIMDB.dbo.Imported_Person

--MOVIE
INSERT INTO FLETNIX.dbo.Movie
SELECT CAST( Id AS int) AS movie_id,
Name AS title,
NULL,
NULL,
YEAR AS publication_year, 
NULL,
NULL,
5,
NULL
FROM MYIMDB.dbo.Imported_Movie
WHERE year BETWEEN 1981 AND YEAR(GETDATE())

--MOVIE CAST TABEL
INSERT INTO FLETNIX.dbo.Movie_Cast
SELECT DISTINCT CAST(Mid AS int) AS movie_id, 
CAST( Pid AS int) AS person_id,
Role
FROM MYIMDB.dbo.Imported_Cast
WHERE CAST(Mid AS int) IN (SELECT movie_id FROM FLETNIX.dbo.Movie)
GROUP BY Pid, Mid, role

--GENRE
INSERT INTO FLETNIX.dbo.Genre
SELECT DISTINCT Genre AS genrenaam, NULL
FROM MYIMDB.dbo.Imported_Genre

--MOVIE DIRECTOR
INSERT INTO FLETNIX.dbo.Movie_Directors
SELECT CAST( MId AS int) AS movie_id ,
(CAST( DId AS int) + (SELECT MAX(CAST(Id as INT)) FROM MYIMDB.dbo.Imported_Person)) AS person_id
FROM MYIMDB.dbo.Imported_Movie_Directors
WHERE CAST(MId AS int) IN (SELECT movie_id FROM Fletnix.dbo.Movie)


